script: |
  super -f text -I q5825.spq | sort > q5825.out

inputs:
  - name: q5825.spq
    data: |
      SELECT DISTINCT + 61 / col0 AS col0 FROM tab0 (FORMAT parquet) WHERE - - col2 * - col1 * - col1 NOT BETWEEN - - col1 AND + col2;
  - name: tab0

outputs:
  - name: q5825.out
    data: |
      0
      4
